// DOM Ready
(function($) {
	'use strict';
    
    var _app = window._app || {};
    
    _app.foundation_init = function() {
        $(document).foundation();
    }
        
    _app.emptyParentLinks = function() {
            
        $('.menu li a[href="#"]').click(function(e) {
            e.preventDefault ? e.preventDefault() : e.returnValue = false;
        });	
        
    };
    
    _app.fixed_nav_hack = function() {
        $('.off-canvas').on('opened.zf.offCanvas', function() {
            $('header.site-header').addClass('off-canvas-content is-open-right has-transition-push');		
            $('header.site-header #top-bar-menu .menu-toggle-wrap a#menu-toggle').addClass('clicked');	
        });
        
        $('.off-canvas').on('close.zf.offCanvas', function() {
            $('header.site-header').removeClass('off-canvas-content is-open-right has-transition-push');
            $('header.site-header #top-bar-menu .menu-toggle-wrap a#menu-toggle').removeClass('clicked');
        });
        
        $(window).on('resize', function() {
            if ($(window).width() > 1023) {
                $('.off-canvas').foundation('close');
                $('header.site-header').removeClass('off-canvas-content has-transition-push');
                $('header.site-header #top-bar-menu .menu-toggle-wrap a#menu-toggle').removeClass('clicked');
            }
        });    
    }
    
    _app.display_on_load = function() {
        $('.display-on-load').css('visibility', 'visible');
    }
    
    // Custom Functions
    
    _app.mobile_takover_nav = function() {
        $(document).on('click', 'a#menu-toggle', function(){
            
            if ( $(this).hasClass('clicked') ) {
                $(this).removeClass('clicked');
                $('#off-canvas').fadeOut(200);
            
            } else {
            
                $(this).addClass('clicked');
                $('#off-canvas').fadeIn(200);
            
            }
            
        });
    }
    
    _app.roster_slider = function() {
        let rosterSlider = document.querySelector('.swiper.roster-slider');
        if( rosterSlider.length < 1 ) return;
        
        $(rosterSlider).slideUp(0);
        
        const swiper = new Swiper(rosterSlider, {
            loop: false,
            on: {
                slideChange: function () {
                    // Remove active from all
                    document.querySelectorAll('.roster-nav a').forEach(el => el.classList.remove('active'));
                    // Add active to current
                    const activeIndex = this.realIndex;
                    const activeItem = document.querySelector(`.roster-nav a[data-slide-index="${activeIndex}"]`);
                    if (activeItem) activeItem.classList.add('active');
                }
            }
        });
            
        // Menu click handler
        document.querySelectorAll('.roster-nav a').forEach(li => {
            li.addEventListener('click', e => {
                e.preventDefault();
                if( !rosterSlider.classList.contains('shown') ) {
                    $(rosterSlider).slideDown(300);
                    rosterSlider.classList.add('shown');
                }
                const index = parseInt(li.getAttribute('data-slide-index'), 10);
                swiper.slideTo(index);
            });
        });
    }
            
    _app.init = function() {
        
        // Standard Functions
        _app.foundation_init();
        _app.emptyParentLinks();
        _app.fixed_nav_hack();
        _app.display_on_load();
        
        // Custom Functions
        //_app.mobile_takover_nav();
        // _app.roster_slider();
    }
    
    
    // initialize functions on load
    $(function() {
        _app.init();
    });
	
	
})(jQuery);